script: |
  super -f text -I q8096.spq | sort > q8096.out

inputs:
  - name: q8096.spq
    data: |
      SELECT DISTINCT col2 + col2 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE - col1 * + CAST ( NULL AS REAL ) * - 11 BETWEEN NULL AND + col1 + + 78;
  - name: tab0

outputs:
  - name: q8096.out
    data: |
